import React, { Component, useState } from 'react';
import { Button, Modal, Form } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import "./floating_window_component.css"
import 'bootstrap/dist/css/bootstrap.min.css';
import "./floating_window_component.css"
import * as Constants from '../../constants/floating_window_constants.js'

function NewEntry() {
  const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  return (
    <>

      <Button onClick={handleShow} style={{  position: 'fixed', right: 30, bottom: 150, width: 80, height: 80, borderRadius: 100, fontSize: 40, fontWeight: 300, textAlign: "center" }} variant="success">
        +
      </Button>
      <div className="modal-w">
        <Modal show={show} onHide={handleClose}>
          <div className="send-password-header">
            <Modal.Header closeButton>
              <Modal.Title>
                <div className="white-title">
                  New Entry
            </div>
              </Modal.Title>
            </Modal.Header>
          </div>

          <Modal.Body>
            <div className="card-add-header">
              <input
                placeholder="Title"
                type="text"
                noValidate
              />
            </div>

            <Form.Group controlId="formBasicEmail">
              <div className="input-group">
                <div className="input-group-prepend ">
                  <span className="input-group-text textform" id="basic-addon textform">
                    <i className="fas fa-pencil-alt prefix textform"></i>
                  </span>
                </div>
                <textarea className="form-control" id="exampleFormControlTextarea1" rows="5"></textarea>
              </div>
            </Form.Group>

          </Modal.Body>
          <Modal.Footer>
            <Button style={{ opacity: 0.9, width: 100 }} variant="secondary" onClick={handleClose}>
              {Constants.FloatingWindowButtonClose}
            </Button>
            <Button style={{ opacity: 0.9, width: 100 }} variant="success" onClick={handleClose}>
              Add
          </Button>
          </Modal.Footer>
        </Modal>
      </div>

    </>
  );
}

class NewEntryComponent extends Component {
  render() {
    return (
      <div><NewEntry/></div>
    );
  }
}

export { NewEntryComponent };
